import React, { Component } from "react";
import Box from "../Box/Box";
import ReactDOM from "react-dom";
import "./Grid.css";
class Grid extends Component {
  constructor(props) {
    super(props);
    this.state = {
      numRows: props.numRows,
      numCols: props.numCols,
    };
  }

  render() {
    this.fillTable();
    return null;
  }

  PrintEle(ele) {
    console.log(ele);
  }
}

export default Grid;
